import React, { useState } from 'react';
import { Route, Link, Routes, Navigate } from 'react-router-dom';
import '../styles/AdminDashboard.css';
import ManageUsers from './ManageUsers';
import ManageArtworks from './ManageArtworks';
import SiteSettings from './SiteSettings';
import AdminNavbar from '../components/AdminNavbar';

const AdminHomePage = () => {
  const [isSidebarExpanded, setIsSidebarExpanded] = useState(false);

  return (
    <div className="admin-dashboard">
      {/* Sidebar */}
      <AdminNavbar />
      {/* Main Content */}
      <div 
        className="dashboard-content" 
        style={{ marginLeft: isSidebarExpanded ? '200px' : '60px' }}
      >
        <h1>Admin Dashboard</h1>
        <p>Welcome to the Admin Dashboard where you can manage users, artworks, and permissions.</p>

        <div className="dashboard-overview">
          <h2>Overview</h2>
          <div className="dashboard-stats">
            <div className="stat">
              <h3>Total Users</h3>
              <p>150</p> {/* Replace with dynamic data */}
            </div>
            <div className="stat">
              <h3>Active Sessions</h3>
              <p>45</p> {/* Replace with dynamic data */}
            </div>
            <div className="stat">
              <h3>Artworks Published</h3>
              <p>320</p> {/* Replace with dynamic data */}
            </div>
            <div className="stat">
              <h3>Pending Approvals</h3>
              <p>10</p> {/* Replace with dynamic data */}
            </div>
          </div>
        </div>

        <div className="recent-activities">
          <h2>Recent Activities</h2>
          <ul>
            <li>New user registered: John Doe</li>
            <li>Artworks uploaded: "Sunset Overdrive"</li>
            <li>Profile updated: Jane Smith</li>
            <li>Content approved: "Nature's Beauty"</li>
          </ul>
        </div>

        <div className="quick-links">
          <h2>Quick Links</h2>
          <div className="link-container">
            <Link to="/admin/manage-users">Manage Users</Link>
            <Link to="/admin/manage-artworks">Manage Artworks</Link>
            <Link to="/admin/site-settings">Site Settings</Link>
          </div>
        </div>

        <div className="page-content">
        <Routes>
  <Route path="/a" element={<HomeContent />} /> {/* Default admin home */}
  <Route path="/admin/manage-users" element={<ManageUsers />} />
  <Route path="/admin/manage-artworks" element={<ManageArtworks />} />
  <Route path="/admin/site-settings" element={<SiteSettings />} />
  <Route path="*" element={<Navigate to="/" />} /> {/* Fallback to admin home */}
</Routes>

        </div>
      </div>
    </div>
  );
};

const HomeContent = () => (
  <div>
    <h2>Welcome, Admin!</h2>
    <p>This is your admin home page where you can find an overview of the dashboard functionalities.</p>
  </div>
);

export default AdminHomePage;
